oE("common/heap.effekt","module heap\nimport resizable_array\n\n/// Resizable 2-ary min-heap, backed by a resizable array\n/// `cmp` defines the ordering of elements\nrecord Heap[T](rawContents: ResizableArray[T], cmp: (T, T) \x3d\x3e Ordering at {})\n\n/// Make a new Heap with the given comparison operation\ndef heap[T](cmp: (T,T) \x3d\x3e Ordering at {}) \x3d \n  Heap[T](resizableArray(), cmp)\n\n/// Make a new Heap with the given comparison operation and initial capacity\ndef heap[T](cmp: (T,T) \x3d\x3e Ordering at {}, capacity: Int) \x3d \n  Heap[T](resizableArray(capacity), cmp)\n\nnamespace internal {\n  def left(idx: Int) \x3d 2 * idx + 1\n  def right(idx: Int) \x3d 2 * idx + 2\n  def parent(idx: Int) \x3d (idx - 1) / 2\n\n  def bubbleUp[A](heap: Heap[A], idx: Int) \x3d {\n    val arr \x3d heap.rawContents\n    arr.boundsCheck(idx) // idx \x3e parent(idx), parent(parent(idx)) etc\n\n    def go(idx: Int): Unit \x3d {\n      if (idx \x3e 0 and (heap.cmp)(arr.unsafeGet(parent(idx)), arr.unsafeGet(idx)) is Greater()) {\n        arr.unsafeSwap(parent(idx), idx)\n        go(parent(idx))\n      }\n    }\n    go(idx)\n  }\n  def sinkDown[A](heap: Heap[A], idx: Int) \x3d {\n    val arr \x3d heap.rawContents\n\n    def infixLt(x: A, y: A) \x3d {\n      if ((heap.cmp)(x,y) is Less()) { true } else { false }\n    }\n    \n    def go(idx: Int): Unit \x3d {\n      if (right(idx) \x3c arr.size) {\n        val v \x3d arr.unsafeGet(idx)\n        val l \x3d arr.unsafeGet(left(idx))\n        val r \x3d arr.unsafeGet(right(idx))\n        if (l \x3c v \x26\x26 r \x3c v) {\n          // swap with the smaller one\n          if (l \x3c r) {\n            arr.unsafeSwap(left(idx), idx)\n            go(left(idx))\n          } else {\n            arr.unsafeSwap(right(idx), idx)\n            go(right(idx))\n          }\n        } else if (l \x3c v) {\n          arr.unsafeSwap(left(idx), idx)\n          go(left(idx))\n        } else if (r \x3c v) {\n          arr.unsafeSwap(right(idx), idx)\n          go(right(idx))\n        }\n      } else if (left(idx) \x3c arr.size) {\n        if (arr.unsafeGet(left(idx)) \x3c arr.unsafeGet(idx)) {\n          arr.unsafeSwap(left(idx), idx)\n          go(left(idx))\n        }\n      } // else: we are at the bottom\n    }\n    go(idx)\n  }\n}\n\n/// Insert value into heap\n///\n/// O(log n) worst case if capacity suffices, O(1) average\ndef insert[T](heap: Heap[T], value: T): Unit \x3d {\n  with on[OutOfBounds].panic();\n  val idx \x3d heap.rawContents.add(value)\n  internal::bubbleUp(heap, idx)\n}\n\n/// find and return (but not remove) the minimal element in this heap\n///\n/// O(1)\ndef findMin[T](heap: Heap[T]): T / Exception[OutOfBounds] \x3d {\n  heap.rawContents.get(0)\n}\n\n/// find and remove the minimal element in this heap\n///\n/// O(log n)\ndef deleteMin[T](heap: Heap[T]): T / Exception[OutOfBounds] \x3d {\n  val res \x3d heap.rawContents.get(0)\n  heap.rawContents.unsafeSet(0, heap.rawContents.popRight())\n  internal::sinkDown(heap, 0)\n  res\n}\n\n/// Number of elements in the heap\n///\n/// O(1)\ndef size[T](heap: Heap[T]): Int \x3d {\n  heap.rawContents.size\n}");
